@conrad.javier joins us to share what it’s like to be an Illustrator and Creative Director. He’s worked with brands from @bleacherreport @nba to even @chicagobulls

We harped a lot on self-awareness and empathy and how we use it to gauge what our dream clients are looking for (or would like) and how the magic is in the process. Prestige and awards fade over time, but if you can find something you genuinely love grinding at, you’ve won. If you’ve found that and you grind at it, everything else is inevitable.

